import React from "react";
import ReactDOM from "react-dom";

const Card = () => {
  return (
    <div>
      <div class="grid-item">
        <img src={image1} />
        <div class="info">
          <h4 class="project-name">Title of the work</h4>
          <h4 class="project-type">Product Design</h4>
        </div>
      </div>
    </div>
  );
};

export default Card;
